css:
.root {
  font: menu;
}

.hint {
  font-size: 13px;
  padding: 2px;
  color: #3c3836;
  background-color: #d5c4a1;
  border: solid 1px rgba(0, 0, 0, 0.5);
  text-transform: uppercase;
  font-weight: bold;
  line-height: 1;
  white-space: nowrap;
}

.highlighted {
  background-color: #d5c4a1;
}

.matchedChars {
  opacity: 0.5;
}

.matchedText {
  border-bottom: 2px solid #83a598;
  box-sizing: border-box;
}

.status {
  font-size: 14px;
  padding: 4px 6px;
  color: #3c3836;
  background-color: #fbf1c7;
  box-shadow: 0 0 1px 0 rgba(0, 0, 0, 0.5);
  bottom: 0;
  right: 0;
  line-height: 1;
}

.peek .hint:not(.hasMatchedChars):not(.highlighted) {
  opacity: 0.2;
}

.mixedCase {
  text-transform: none;
}

.hidden,
.hint:not(.hidden) ~ .shruggie,
.status:empty {
  opacity: 0 !important;
}
